import React, { useState, useEffect } from 'react';

const Leaderboard = () => {
    const [players, setPlayers] = useState([]);

    useEffect(() => {
      const fetchLeaderboardData = async () => {
        try {
          const response = await fetch('http://localhost:3001/leaderboard'); // Replace with your actual API endpoint
          if (!response.ok) {
            throw new Error('Network response was not ok');
          }
          const data = await response.json();
          setPlayers(data);
        } catch (error) {
          console.error('There has been a problem with your fetch operation:', error);
        }
      };

      fetchLeaderboardData();
    }, []);

    return (
      <div>
        <h1>Leaderboard</h1>
        <table>
          <thead>
            <tr>
              <th>Player</th>
              <th>Score</th>
            </tr>
          </thead>
          <tbody>
            {players.map((player, index) => (
              <tr key={index}>
                <td>{player.username}</td>
                <td>{player.highScore}</td> {/* Adjust this based on your data structure */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );

};
